import React from 'react';

import Name from './Name.js';
import TextColorizer from './TextColorizer.js';
//import Repository from './Repository.js';
import Timer from './Timer.js';
import Toggle from './Toggle.js';
import LoginControl from './LoginControl.js';
import Greeting from './Greeting.js'

import logo from './assets/images/logo.svg';
import logoRed from './assets/images/logoRed.png';
import logoYellow from './assets/images/logoYellow.png';
import logoGreen from './assets/images/logoGreen.png';
//import js from './assets/images/js.png';
//import shakaWhite from './assets/images/shakaWhite.png';
import shakaBlack from './assets/images/shakaBlack.png';
import './css/App.css';

const user = { firstName: 'John', lastName: 'Santucci'};
const company = "KFA";
function App() {
  return (
    <div className="App">
      <div className="flexContainer header">
        <div className="flex3Column bg-green" />
        <div className="flex3Column bg-yellow" />
        <div className="flex3Column bg-red" />
      </div>
      <header className="App-header">
        <img id="shaka" src={shakaBlack} className="shaka shakingShaka absolute" alt="js" />
        <div className="flexContainer">
          <div className="flex3Column height200" />
          <div className="flex3Column height200">
            <img id="logo1" src={logoRed} className="z1 logo1 absolute logo height200 ml-100" alt="logoRed" />
            <img id="logo2" src={logoYellow} className="z2 logo2 absolute logo height200 ml-100" alt="logoYellow" />
            <img id="logo3" src={logoGreen} className="z3 logo3 absolute logo height200 ml-100" alt="logoGreen" />
          </div>
          <div className="flex3Column height200" />
        </div>
        {/*<Name user={user}/>*/}
        <TextColorizer text={company}/>
        {/*<Repository name="charliewilco/obsidian" />*/}
        <a className="App-link"
          href="https://jsongithub.github.io/portfolio/"
          target="_self"
          rel="noopener noreferrer"
        >
          portfolio
        </a>
        <div id="time"></div>
        <div className="flexContainer height200 b-0">
          <div className="flex3Column bg-dk-red m-1 p-10">
            <div id="login"></div>
          </div>
          <div className="flex3Column bg-dk-yellow m-1 p-10" />
          <div className="flex3Column bg-dk-green m-1 p-10">
            <div id="toggle"></div>
          </div>
        </div>
      </header>
      <div className="flexContainer footer">
        <div className="flex3Column bg-red" />
        <div className="flex3Column bg-yellow" />
        <div className="flex3Column bg-green" />
      </div>
    </div>
  );
}

export default App;
